import React from "react";
import {
  ButtonBack,
  ButtonFirst,
  ButtonLast,
  ButtonNext,
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  DotGroup,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={100}
      naturalSlideHeight={125}
      totalSlides={3}
    >
      <div>
        <Dot slide={0}>1</Dot>
        <Dot slide={1}>2</Dot>
        <Dot slide={2}>3</Dot>
      </div>

      <Slider
        style={{ color: "#eee", backgroundColor: "yellow", height: "100%" }}
      >
        <Slide index={0}>
          <div
            style={{ width: "100%", height: "500px", backgroundColor: "red" }}
          ></div>
        </Slide>
        <Slide index={1}>
          <div
            style={{ width: "100%", height: "500px", backgroundColor: "blue" }}
          ></div>
        </Slide>
        <Slide index={2}>
          <div
            style={{ width: "100%", height: "500px", backgroundColor: "green" }}
          ></div>
        </Slide>
      </Slider>
    </CarouselProvider>
  );
};

export default SlickCard;
